script: |
  super -f text -I q5832.spq | sort > q5832.out

inputs:
  - name: q5832.spq
    data: |
      SELECT DISTINCT - 77 AS col1 FROM tab2 (FORMAT parquet) WHERE + - 43 NOT BETWEEN 20 * col0 + + ( - 18 ) * - 80 * + 68 AND NULL;
  - name: tab2

outputs:
  - name: q5832.out
    data: |
      -77
